import{_ as e,c as t,o as a,a7 as _}from"./chunks/framework.SbOxrpL8.js";const s="/images/2007/03/200703272316140162.gif",u=JSON.parse('{"title":"抱歉，手机如二奶，不外借！","description":"","frontmatter":{"title":"抱歉，手机如二奶，不外借！","tags":["多普达","mobile"],"id":931,"categories":["Life"],"abbrlink":"6e7fdbb8","date":"2007-03-27T22:40:08.000Z"},"headers":[],"relativePath":"Life/抱歉_手机如二奶_不外借.md","filePath":"Life/抱歉_手机如二奶_不外借.md","lastUpdated":1721497158000}'),i={name:"Life/抱歉_手机如二奶_不外借.md"},o=_('<p>我确实不想发这样的文章，一来不符合我这性格，二来会被鄙视，但还是要说，我一直不怕被鄙视的，也希望大家能多小心</p><p>今天手机被借给同事做测试，好像要开发个电脑连手机发短信的鬼东西，而公司只有我一人带了手机数据线，不幸啊，就这样把心爱的手机奉上了。由于连接不上，被玩弄一番之后，手机归来。估计买的那个鬼控件不支持USB连接或不支持智能手机。然后下午下班之后想打电话，发现电话簿全部丢失，而且手机变得非常非常缓慢，重启N次之后依旧，幸运的是前天晚上做过备份，无奈只好硬启，恢复了通讯录和短信，终于正常了，装了个闹钟程序pTravelAlarm，没空去搞其它东西了，用用先吧</p><p>老猫很小气的，以下物品不外借，死党除外</p><ol><li>笔记本</li><li>手机</li><li>相机</li><li>计算机书</li><li>羽拍、乒乓球拍</li></ol><p>今天突然想起以前也写过手机连电脑发短信的程序，VB写的，用的是微软的COMM控件，直接用AT指令发送的</p><p>附上相关文章</p><ol><li>~~在PC上通过手机发送短消息 /bbs/a/a.asp?BoardID=340&amp;ID=11122 作者：lotusswan <a href="http://dev.csdn.net/user/lotusswan~~" target="_blank" rel="noreferrer">http://dev.csdn.net/user/lotusswan~~</a></li><li><s>AT指令编程必读 /bbs/a/a.asp?BoardID=340&amp;ID=11124&quot;</s></li></ol><p><img src="'+s+'" alt="SMS"></p>',8),l=[o];function r(p,n,d,c,f,m){return a(),t("div",{"data-pagefind-body":!0},l)}const T=e(i,[["render",r]]);export{u as __pageData,T as default};
